Description

Genere: Thriller
Director: Rakesh Sawant
Producer: Rajesh Agarwal, K K Agarwal
Star Cast: Rajesh Khanna, Sudesh Berry, Sara Khana

Beena (Saara Khan) is married to Amritlal Chopra (Rajesh Khanna), a man more than double her age. Amritlal Chopra is a rich businessman based in Thailand. Unfortunately for Beena, she cannot have a child because Amritlal is asthmatic and, therefore, cannot perform in bed. Beena's frustration drives her to their driver, Raj, to whom she runs every now and then to be sexually satisfied. One day, Beena pushes her husband into the valley, in the presence of Raj. She puts the police off-track by saying that her husband's fall was an accident. The police find a body in the valley but it is beyond recognition.
Taking Amritlal to be dead, Beena and Raj become owners of Amritlal's huge bungalow and business empire, but soon, Amritlal reappears, and insists that he is Beena's husband who loves her dearly. Beena is jolted out of her senses and alleges foul play. Convinced that her husband is dead, she informs the police that somebody was impersonating her late husband. Even Amritlal's sister, Priya, and her boyfriend, Sandy, are called from America to identify Amritlal. Ultimately, Raj spills the beans to the police about Amritlal's murder at the hands of Beena. Keen on hearing Beena's own confession, the police and Amritlal hound her till Beena breaks down and admits to killing Amritlal, insisting that the new Amritlal was an imposter. The truth was that Amritlal had not died but had sustained injuries and had re-emerged after hospitalization.
